import React, { Component } from 'react';
import {Button, Navbar, NavItem, Row, Icon} from 'react-materialize'
import './LandingPage.css'


class LandingPage extends Component {
    render(){
        return(
            <div>
                <Navbar className="white" brand='logo' right>
                    <NavItem onClick={() => console.log('test click')}>PRICING</NavItem>
                    <NavItem href='components.html' > <span className="navitem-color">LOG IN</span>LOG IN</NavItem>
                    <NavItem href='components.html'>REGISTER</NavItem>
                </Navbar>
            </div>

        )
    }
};

export default LandingPage;
